import React, { useState } from "react";
import "./Home.css";
import { Link, Routes, Route, useNavigate } from 'react-router-dom';
import Personality from "./Personality";

const Home = () => {
  const navigate = useNavigate();


  function handleClick(event) {
    event.preventDefault();
    navigate("/personality");
  }

  return (
    <React.Fragment>
      <Link to="/personality"></Link>
      <Routes>
        <Route path="/personality" element={<Personality />} />
      </Routes>
      <div className='main-container'>
        <span className='text'>Find your match</span>
        <div className='wrapper-2'>
          <span className='text-2'>
            We match compatibility based on:
            <br />
            Personality
            <br />
            Aestheticism
            <br />
            Lifestyle
          </span>
        </div>
        <span className='text-3'>Horoscope</span>
        
        <form>
            <div className="form-group">
            <input onChange={handleChange} name="title" value = {input.title} autoComplete="off" className="form-control" placeholder="notetitle"></input>
            </div>
            <div className="form-group">
            <textarea onChange={handleChange} name="content" value = {input.content} autoComplete="off" className="form-control"  placeholder="notecontent"></textarea>
            </div>
            <button onClick={handleClick} className="btn btn-lg btn-info">ADD NOTE</button>
        </form>
          <button onClick={handleClick} className="btn_text">
            Lets go !!
          </button>
        
      </div>
    </React.Fragment>
  );
};


export default Home;
